import React from "react";
//import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navbar/navBar";
import Footer from "./components/footer/footer";

function App() {
  return (
    <div className="App">
      <NavBar></NavBar>
      <h1>Hello there</h1>
      <NavBar></NavBar>
      <NavBar></NavBar>

      <Footer></Footer>
    </div>
  );
}

export default App;
